import React from "react";
import { render } from "react-dom";
import App from "./App";
import {ApolloProvider} from "@apollo/client";
import {categoriesQuery} from "./qraphQL/ApolloClient";
render(
<ApolloProvider client={categoriesQuery}>
  <App />,
</ApolloProvider>,
document.getElementById("root")
);
